import checkPermission from '@/utils/permission'
import initData from '@/mixins/crud'
export default {
  components: {},
  mixins: [initData],
  props: {
    value: {
      type: Object
    }
  },
  data() {
    return {
      myValue: this.value,
      delLoading: false, dialog: false,
      userType: '',
      queryTypeOptions: [
        { key: 'nickname', display_name: '用户昵称' },
        { key: 'phone', display_name: '手机号码' }
      ]
    }
  },
  created() {
    this.$nextTick(() => {
      this.init()
    })
  },
  methods: {
    checkPermission,
    beforeInit() {
      this.url = 'api/yxUser'
      const sort = 'uid,desc'
      this.params = { page: this.page, size: this.size, sort: sort }
      const query = this.query
      const type = query.type
      const value = query.value
      if (type && value) { this.params[type] = value }
      return true
    },
    deleteUser() {
      const that = this
      this.$confirm('是否确认删除？', '提示', {
        confirmButtonText: '确定',
        cancelButtonText: '取消',
        type: 'warning'
      }).then(function() {
        //that.myValue = {uid: null,nickname: null,avatar: null}
        that.$set(that.value,"uid", null)
        that.$set(that.value,"nickname", null)
        that.$set(that.value,"avatar", null)
      })
    },
    toSelete() {
      this.dialog = true
    },
    doSelect(data) {
      this.$set(this.value,"uid", data.uid)
      this.$set(this.value,"nickname", data.nickname)
      this.$set(this.value,"avatar", data.avatar)

      this.dialog = false
    }

  }
}
